name: Sonar
main: com.github.Gamecube762.Sonar.Main
author: Gamecube762
version: 0.0.2
prefix: Sonar
commands:
   sonar:
      description: Sonar command
      usage: /<command>
      permission: sonar.command
      permission-message: You don't have <permission>
permissions:
   sonar.command:
      description: command
      default: true
   sonar.noDarkness:
      description: Note Effect
      default: false
   sonar.note:
      description: Note Effect
      default: false